import { Icon } from "react-native-ui-lib";

export default function Header({level}) {

    return (
        <div className='header'>
            
            <div><Icon
          name='rowing' /></div>
            <div>{level ? level: ''}</div>
            <div>settings</div>
        </div>
    );
}
